import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');
    await page.waitForSelector('.mobile-menu', { timeout: 5000 });

    // Take screenshot of mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu.png'));

    // Navigate to a category in the mobile menu
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Take screenshot after navigating to category
    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    return {
      success: true,
      action: "Navigated through mobile menu to Electronics category",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
